import { Link } from 'react-router-dom';
import HWHelperTransparent from '../img/HWHelperTransparent.png';

const Navbar = () => {
    return (
        <header>
            <div className="container">
                <Link to="/">
                    <img src={HWHelperTransparent}/>
                    <h1>Homework Helper</h1>
                </Link>
            </div>
        </header>
    )
}

export default Navbar
